            <IonSelect placeholder="Select a Dog" name="type" id="type"  >
              {
                dogs.map((el, index) => {
                  return (<IonSelectOption value={el.id} key={index} selected={adopting === el.id && input === 'dog_1'}>{el.name}</IonSelectOption>);
                })
              }
            </IonSelect>

          </IonItem>
         
          {/* <IonItem>
                        <IonLabel position="floating" >Utilisateur</IonLabel>
                        <IonInput type="text" name="Utilisateur" id="datedenaissance" ></IonInput>
                    </IonItem> */}
          
          <IonItem>
            <IonLabel position="floating">description</IonLabel>
            <IonInput
              type="password"
              name="description"
              id="description"
            ></IonInput>
          </IonItem>
          
          <div className="button-wrapper">
            <IonButton type="submit">valider</IonButton>
          </div>
        </form>
      </IonContent>
    </IonPage>
  );
};

